import React from 'react'
import Particles from 'react-particles-js';
import Navbar from "./Navbar"
import Header from "./Header"

const Home = () => {
    return (
        <div>
            <Particles
                params={{
                    particles: {
                        number:{
                            value: 45
                        } 
                    }
                }}
            />
            <Navbar/>
            <Header/>
        </div>
    )
}

export default Home
